Had a blast on the fast track in @crosspark_reiteralm this past week. Unfortunately the races didn’t go as well as I wanted. All the pieces were there with some fast skiing in qualifying but just not able to put it all together on the race days. Super frustrating 🤬. But on we go! The speed is there, the execution has not been. But that can all change on a dime, just gotta try and keep my head in the game. Happy to walk away in one piece after some gnarly crashes all week. Get well soon to all the people who went down, and congrats to those who found some speed on a tougher track! This vid is me chasing down @krismahler day one of training! As you can see we didn’t exactly have things dialled in just yet! 
