Stoked to be here in Georgia 🇬🇪 representing Canada 🇨🇦 for the 7th time at the Freestyle Ski World Championships! Been a battle with weather so far, but the sun should make an appearance tomorrow and then it’s on for the weekend 🤘🏼. Thanks to my people and my sponsors for all the love and support in getting back here to World Champs! 
