@lululemon @skilouise @elanskis @canfund @oakleyskiing @markerproducts @daineseofficial #alwaysgoodtimes #lululemonambassador #prairieskyroyalties  #canfundrecipient

Definitely felt a World Champs medal slip through my fingers yesterday. A mistake in the semi finals cost me a shot at a medal, and that is going to sting for a while. That said, finishing 7th in my 7th World Champs appearance is something to be proud of. After a tough day in quali (p31) I battled hard all day from the outside gate in yellow and fought my way to a chance at a great day. It’s not easy out there, and there is basically no room for error. These major events are always a wild ride, from qualification through the competition so much effort, work and support goes into one shot, one day. Our team went out there and put 4 men in the top 7, and 4th on the women’s side, but unfortunately no hardware to show for it. There was some awesome skiing & grit shown out there by the Canadians and I’m proud of what our team did out there. @reece_howden and @bigairmar then hit the reset button and competed same day in the mixed team event and took home a silver! Marathon caption but all in all a bittersweet week up in Georgia. This weeks race was cancelled due to lack of snow 😞, but we will be back on course March 12th in Switzerland before heading to Canada for the final World Cups of the season. Thanks if you made it this far in my novel 🙏🏼
